export default function InputBox(){
    const [message, setMessage] = useState('')
    return(
        <>
        {/* onSubmit={handleSubmit} */}
            <form >
                <input
                type='text'
                placeholder="Enter your message..."
                onChange={(e) => setMessage(e.target.value)}
                />
                 <button type="submit">Send</button>
            </form>
        </>
    )
}
